import React, { Component } from "react";

import { Typography, Container, Paper, Grid } from "@material-ui/core";
import OwlCarousel from "react-owl-carousel2";
import "react-owl-carousel2/lib/styles.css";
import Slider from "react-slick";

const Materi = props => {
  return (
    <React.Fragment>
      <Container>
        <img src={props.img} alt="image-slidder" />
      </Container>
      <Typography variant="p">{props.desc}</Typography>
      <Typography variant="p">{props.harga}</Typography>
    </React.Fragment>
  );
};

class Courses extends Component {
  render() {
    return (
      <Container style={{ margin: 0, padding: 0, marginTop: "64px" }}>
        <Container
          fixed
          style={{
            width: "90%",
            marginTop: 20,
            paddingTop: 20,
            height: "700px",
            borderRadius: "25px",
            backgroundColor: "#F1F0FF"
          }}
        >
          <Typography
            component="h3"
            variant="h4"
            style={{ marginBottom: 10, fontWeight: 700, textAlign: "center" }}
          >
            Schedules
          </Typography>
          <Typography
            component="h1"
            align="center"
            variant="h3"
            style={{ textAlign: "center", color: "#EC9120" }}
          >
            Upcoming Events
          </Typography>
          <Container fixed style={{ marginTop: 20, height: "500px" }}>
            <Container
              style={{
                display: "flex",
                backgroundColor: "white",
                borderRadius: "25px",
                padding: 0,
                marginTop: 20,
                height: "150px"
              }}
            >
              <img
                style={{ borderRadius: "25px", maxWidth: "30%", flexGrow: 2 }}
                src={require("../images/republika.jpg")}
                alt="Mamastudio-image"
              />
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Button
                  style={{
                    backgroundColor: "lightblue",
                    fontWeight: "900",
                    borderRadius: "24px",
                    color: "white",
                    marginBottom: "10px"
                  }}
                  href="#"
                  variant="contained"
                >
                  WebSite
                </Button>
                <Typography component="h3" variant="h5">
                  <b>Quantum Computers</b>
                </Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  DATE
                </Typography>
                <Typography>04 Nov 2019</Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  DURATION
                </Typography>
                <Typography>10 Hours</Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  PRICE
                </Typography>
                <Typography>$400</Typography>
              </Container>
            </Container>
            <Container
              style={{
                display: "flex",
                backgroundColor: "white",
                borderRadius: "25px",
                padding: 0,
                marginTop: 20,
                height: "150px"
              }}
            >
              <img
                style={{ borderRadius: "25px", maxWidth: "30%", flexGrow: 2 }}
                src={require("../images/republika.jpg")}
                alt="Mamastudio-image"
              />
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Button
                  style={{
                    backgroundColor: "pink",
                    fontWeight: "900",
                    borderRadius: "24px",
                    color: "white",
                    marginBottom: "10px"
                  }}
                  href="#"
                  variant="contained"
                >
                  DESIGN
                </Button>
                <Typography component="h3" variant="h5">
                  <b>Mechanics</b>
                </Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  DATE
                </Typography>
                <Typography>04 Nov 2019</Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  DURATION
                </Typography>
                <Typography>10 Hours</Typography>
              </Container>
              <Container
                style={{
                  padding: "20px"
                }}
              >
                <Typography
                  style={{
                    marginBottom: "30px",
                    fontWeight: "light",
                    color: "grey"
                  }}
                >
                  PRICE
                </Typography>
                <Typography>$400</Typography>
              </Container>
            </Container>
            <Container
              style={{
                display: "flex",
                backgroundColor: "white",
                borderRadius: "25px",
                padding: 0,
                marginTop: 20,
                height: "150px"
              }}
            >
              <Materi
                img={require("../images/image1.jpg")}
                desc="belajar SEO"
                harga="120000"
              />
              <Materi
                img={require("../images/image2.jpg")}
                desc="belajar google adword"
                harga="400000"
              />
              <Materi
                img={require("../images/image3.jpg")}
                desc="belajar react js"
                harga="500000"
              />
            </Container>
          </Container>
        </Container>
      </Container>
    );
  }
}

export default Courses;
